import React from "react";

export default function MySongs() {
  const songs = [
    { title: "Sunset Groove", artist: "DJ Solis", details: "Vocals +2 dB, Bass +1 dB, Drums -3 dB" },
    { title: "Rainy Lo-Fi", artist: "SynthCloud", details: "Drums -2 dB, Other +4 dB" },
    { title: "Chillwave Mix", artist: "Neon Dreamer", details: "Vocals 0 dB, Bass +3 dB" },
    { title: "Indie Rock", artist: "EchoState", details: "Vocals +1 dB, Drums +2 dB, Other -2 dB" },
  ];

  return (
    <div className="relative bg-[#151931]/70 backdrop-blur-lg border border-[#2a2f4a] rounded-2xl p-6 shadow-lg text-gray-100">
      <h2 className="text-xl font-semibold mb-4">üéµ My Songs</h2>
      <ul className="space-y-3">
        {songs.map((song, i) => (
          <li
            key={i}
            className="p-4 border border-[#2a2f4a] rounded-xl hover:border-blue-500 transition"
          >
            <div className="flex flex-col sm:flex-row sm:justify-between sm:items-center">
              <div>
                <h3 className="font-semibold text-lg">{song.title}</h3>
                <p className="text-sm text-gray-400">{song.artist}</p>
                <p className="text-xs mt-2 text-gray-300 whitespace-pre-line">
                  {song.details}
                </p>
              </div>
              <div className="flex gap-2 mt-3 sm:mt-0">
                <button className="px-3 py-1 bg-blue-500 hover:bg-blue-600 rounded text-black font-semibold text-sm">
                  ‚ñ∂ Play
                </button>
                <button className="px-3 py-1 bg-red-500 hover:bg-red-600 rounded text-white font-semibold text-sm">
                  ‚èπ Stop
                </button>
              </div>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
}
